import React, { Component } from "react";

export class App extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-12 bg-dark">
            <h1>Header</h1>
          </div>
          <div className="row">
            <div className="col-12 col-lg-4 bg-info">
              <h1>Register</h1>
            </div>
            <div className="col-12 col-lg-8 bg-warning">
              <h1>Information</h1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
